Excel.run(async (context) => {
  try {
    const sheet = context.workbook.worksheets.getActiveWorksheet();
    sheet.load("name");
    await context.sync();

    const originalName = sheet.name;
    const newSheet = sheet.copy(Excel.WorksheetPositionType.after, sheet);
    newSheet.name = originalName + " (副本)";
    newSheet.activate();

    await context.sync();
  } catch (error) {
    console.error("复制工作表时出错:", error);
    throw error;
  }
});


